schemas.content:
# An athlete
type Athlete {
  email: String!
  firstName: String!
  id: ID!
  lastName: String!
  password: String!
}

# Autogenerated input type of CreateAthlete
input CreateAthleteInput {
  # A unique identifier for the client performing the mutation.
  clientMutationId: String
  email: String!
  firstName: String!
  lastName: String!
  password: String!
}

# Autogenerated return type of CreateAthlete
type CreateAthletePayload {
  athlete: Athlete

  # A unique identifier for the client performing the mutation.
  clientMutationId: String
}

# A Exercise
type Exercise {
  exerciseName: String!
  id: ID!
  sets: [Set]
}

type Mutation {
  # Create an athlete and return a new athlete
  createAthlete(input: CreateAthleteInput!): CreateAthletePayload
}

type Query {
  # Find a Athleter by ID
  athlete(id: ID!): Athlete

  # Workouts of Current Athlete
  workout: [Workout]
}

# A Set
type Set {
  id: ID!
  number: Int!
  rep: Int!
  unit: String!
  weight: Int!
}

# A workout
type Workout {
  exercises: [Exercise]
  id: ID!
  workoutName: String!
}
